edition = "2023";

package youtube.elements.components;

import "youtube/elements/components/theme.proto";
import "youtube/elements/context.proto";
import "youtube/elements/environment_data.proto";

option java_package = "com.google.protos.youtube.elements.components";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "ELMPB";

message SeekEduOverlayModel {
	Theme theme = 1;
	Context context = 2;
	EnvironmentData environment = 3;
	string slide_to_seek_text = 6;
	string pull_up_for_fine_scrubbing_text = 7;
	string overlay_identifier = 8;
	bool enable_player_overlay_state_change_block_api = 9;
	string speedmaster_active_text = 10;
	string seek_cancellation_text = 11;
}
